// Galeri
const btnPrev = document.querySelector('[data-galeri="btn-prev"]');
const btnNext = document.querySelector('[data-galeri="btn-next"]');
const btnGaleri = document.querySelectorAll('[data-galeri="btn"');

btnNext.addEventListener('click', () => {
  const galeriShow = document.querySelector('[data-galeri="show"]');
  const galeriShowIndex = galeriShow.getAttribute('data-index-show');
  let nextImg = parseInt(galeriShowIndex) + 1;
  if (nextImg > 6) {
    nextImg = 1;
  }
  galeriShow.setAttribute('src', `public/img/ast ${nextImg}.png`);
  galeriShow.setAttribute('data-index-show', nextImg);
  checkNextImg(nextImg);
});

btnPrev.addEventListener('click', () => {
  const galeriShow = document.querySelector('[data-galeri="show"]');
  const galeriShowIndex = galeriShow.getAttribute('data-index-show');
  let nextImg = parseInt(galeriShowIndex) - 1;
  if (nextImg < 1) {
    nextImg = 6;
  }
  galeriShow.setAttribute('src', `public/img/ast ${nextImg}.png`);
  galeriShow.setAttribute('data-index-show', nextImg);
  checkNextImg(nextImg);
});

for (let i = 0; i < btnGaleri.length; i++) {
  btnGaleri[i].addEventListener('click', (e) => {
    const galeriShow = document.querySelector('[data-galeri="show"]');
    const indexBtn = e.target.getAttribute('data-galeri-index');
    galeriShow.setAttribute('src', `public/img/ast ${indexBtn}.png`);
    galeriShow.setAttribute('data-index-show', indexBtn);
    for (let i = 0; i < btnGaleri.length; i++) {
      btnGaleri[i].classList.remove('ring-4');
      btnGaleri[i].classList.remove('ring-gray-600');
    }
    e.target.classList.add('ring-4');
    e.target.classList.add('ring-gray-600');
  });
}

function checkNextImg(nextImg) {
  for (let i = 0; i < btnGaleri.length; i++) {
    btnGaleri[i].classList.remove('ring-4');
    btnGaleri[i].classList.remove('ring-gray-600');
    if (btnGaleri[i].getAttribute('data-galeri-index') == nextImg) {
      btnGaleri[i].classList.add('ring-4');
      btnGaleri[i].classList.add('ring-gray-600');
    }
  }
}

// ? Dark mode - Light mode
const darkMode = document.querySelector('#dark-mode');
const lightMode = document.querySelector('#light-mode');
const descMode = document.querySelector('#desc-mode');
const htmlDom = document.querySelector('html');
htmlDom.setAttribute('class', localStorage.getItem('theme'));
document.querySelector('#timeline').innerHTML = localStorage.getItem('timeline');
document.querySelector('#bukuBg').innerHTML = localStorage.getItem('bukuBg');
document.querySelector('#galeriBg').innerHTML = localStorage.getItem('galeriBg');
if (localStorage.getItem('theme') == "dark") {
  darkMode.classList.add('hidden');
  lightMode.classList.remove('hidden');
} else {
  darkMode.classList.remove('hidden');
  lightMode.classList.add('hidden');
}

darkMode.addEventListener('mouseover', () => {
  descMode.innerHTML = "Dark Mode";
  descMode.classList.add('show');
});
darkMode.addEventListener('mouseout', () => {
  descMode.classList.remove('show');
});
lightMode.addEventListener('mouseover', () => {
  descMode.innerHTML = "Light Mode";
  descMode.classList.add('show');
});
lightMode.addEventListener('mouseout', () => {
  descMode.classList.remove('show');
});
