// ? Nav Active
const linkNav = document.querySelectorAll('.link');
const liNav = document.querySelectorAll('.link li');
for (let i = 0; i < linkNav.length; i++) {
  linkNav[i].addEventListener('click', (e) => {
    for (let i = 0; i < linkNav.length; i++) {
      liNav[i].classList.remove('active');
    }
    liNav[i].classList.add('active');
  });
}

document.querySelector('#arrowA').addEventListener('click', () => {
  liNav[0].classList.add('active');
});